import * as React from 'react';
import styled, { keyframes } from 'styled-components';
import { darken } from 'polished';

const opacityAnimation = keyframes`
  0% {
    opacity: 0;
  }

  100% {
    opacity: 1;
  }
`;

const transformAnimation = keyframes`
  0% {
    transform: translateY(0);
  }
  100% {
    transform: translateY(-15px);
  }
`;

const bubbleAnimation = keyframes`
  0% {
    opacity: 0;
  }
  30% {
    opacity: 1;
    transform: translate(-15px,-30px)
  }
  60% {
    opacity: 1;
    transform: translate(0,-60px)
  }
  100% {
    opacity: 0;
    transform: translate(15px,-100px);
  }
`;

const Svg = styled.svg`
  will-change: transform;
  .g {
    fill: #3d3d3d;
  }
  .g-shade {
    fill: #b1b1b2;
  }

  .p {
    fill: ${({ theme }): string => theme.p};
    stop-color: ${({ theme }): string => theme.p};
  }

  .p-shade {
    fill: ${({ theme }): string => darken(0.2, theme.p)};
    stop-color: ${({ theme }): string => darken(0.2, theme.p)};
  }

  .s {
    fill: ${({ theme }) => theme.s};
    stop-color: ${({ theme }): string => theme.s};
  }
  .s-shade {
    fill: ${({ theme }) => darken(0.2, theme.s)};
    stop-color: ${({ theme }): string => darken(0.2, theme.s)};
  }

  #laptop, #laptop-text, #laptop-graphs, #laptop-shadow, #closed-rounded-square {
    animation: ${transformAnimation} 1s infinite alternate ease-in-out;
  }

  .bubble-type-1 {
    opacity: 0;
    animation: ${bubbleAnimation} 3s 1s infinite linear;
  }
  .bubble-type-2 {
    opacity: 0;
    animation: ${bubbleAnimation} 2s 2s infinite linear;
  }
  .bubble-type-3 {
    opacity: 0;
    animation: ${bubbleAnimation} 2s 1s infinite linear;
  }

  .inner-circle {
    animation: ${opacityAnimation} 2s 1s infinite alternate;
  }
  .inner-circle-1 { animation-delay: 2s}
  .inner-circle-2 { animation-delay: 1s}
  .inner-circle-3 { animation-delay: 4s}
`;

